;&lt;/b&gt;&lt;/i&gt;), \n&lt;br&gt;  &lt;b&gt;Normalized cumulative keyword frequency in the current period (2010-2019)&lt;/b&gt; (&lt;i&gt;&lt;b&gt;F&lt;sub&gt;current&lt;/sub&gt;&lt;/b&gt;&lt;/i&gt;), \n&lt;br&gt;  &lt;b&gt;Trend factor&lt;/b&gt;, and \n&lt;br&gt;  &lt;b&gt;Number of countries/regions that studied the keyword&lt;/b&gt; (&lt;i&gt;&lt;b&gt;N&lt;sub&gt;cr&lt;/sub&gt;&lt;/b&gt;&lt;/i&gt;)\n&lt;br&gt;\n&lt;br&gt; Table below summarizes the corresponding data for the keywords, which are ordered based on trend factor. You can click any parameter to re-order the keywords\n&lt;br&gt;\n\n","width":800},"id":"9236","type":"Div"},{"attributes":{"editor":{"id":"9251","type":"StringEditor"},"field":"KW_freq_past","formatter":{"id":"9250","type":"StringFormatter"},"title":"&lt;i&gt;&lt;b&gt;f&lt;sub&gt;past&lt;/sub&gt;&lt;/b&gt;&lt;/i&gt;"},"id":"9239","type":"TableColumn"},{"attributes":{},"id":"9250","type":"StringFormatter"},{"attributes":{"editor":{"id":"9259","type":"StringEditor"},"field":"KW_ratio","formatter":{"id":"9258","type":"StringFormatter"},"title":"&lt;b&gt;Trend factor&lt;/b&gt;"},"id":"9243","type":"TableColumn"}],"root_ids":["9247"]},"title":"Bokeh Application","version":"1.4.0"}}
